const heading = {
  type: 'h1',
  style: {
    'font-size': '60px',
    color: 'red',
    'text-align': 'center'
  },
  children: ['Q.JS']
};

const subheading = text => {
  return { type: 'h2', children: [text] };
};

const square = {
  dragElement: e => {
    const body = document.body;
    if (square.drag) {
      body.style['user-select'] = 'none';
      const squareElement = document.querySelector('.square');
      const x = e.clientX - square.offsetX - squareElement.offsetLeft;
      const y = e.clientY - square.offsetY - squareElement.offsetTop;
      squareElement.style.transform = `translate(${x}px, ${y}px)`;
    }
  },
  type: 'div',
  style: {
    height: '40px',
    width: '180px',
    'background-color': 'red'
  },
  attributes: {
    class: 'square'
  },
  drag: false,
  offsetX: null,
  offsetY: null,
  events: {
    mousedown: e => {
      square.drag = true;
      square.offsetX = e.offsetX;
      square.offsetY = e.offsetY;
      const body = document.body;
      body.addEventListener('mousemove', e => square.dragElement(e));
    },
    mouseup: () => {
      const body = document.body;
      body.style['user-select'] = 'auto';
      square.drag = false;
      body.removeEventListener('mousemove', e => square.dragElement(e));
    }
  },
  children: ['dont drag me']
};

const button = {
  type: 'button',
  attributes: {
    type: 'button'
  },
  style: {
    padding: '20px',
    border: '1px solid black'
  },
  children: ['dont press this'],
  events: {
    click: () => {
      button.children = ['why'];
    }
  }
};

const h3 = text => {
  return {
    type: 'h3',
    children: [text]
  };
};

const p = text => {
  return {
    type: 'p',
    children: [text]
  };
};

const textArticle = (heading, text) => {
  return {
    type: 'section',
    style: {
      width: '400px'
    },
    children: [h3(heading), p(text)]
  };
};

const threeColumn = {
  type: 'section',
  style: {
    display: 'flex',
    'justify-content': 'space-around'
  },
  children: [
    textArticle(
      'JSX vs HTML?',
      "neither. we're going pure javascript objects. Every component and DOM node will be written as an object. "
    ),
    textArticle(
      'want to target the document or another component directly?',
      'Do it. I support you'
    ),
    textArticle('why isnt this working', 'its a feature')
  ]
};

export default {
  type: 'div',
  children: [
    square,
    heading,
    subheading('a really bad Javascript library for building interfaces'),
    button,
    subheading('Why would anyone use this'),
    threeColumn,
    subheading('Get started'),
    subheading('Documentation')
  ]
};
